// SPDX-License-Identifier: Unlicensed
pragma solidity ^0.8.15;
contract todo 
{
    address owner;

    struct Task {
        string task;
        bool isDone;
    }

    mapping (address => Task[]) private Users;

    function addTask(string memory _task) public {

        Task memory task =  Task(_task,false);

        Users[msg.sender].push(Task({
          task:_task,
          isDone:false
        }));
    }

}

